import React from 'react';

function Three() {
    return (
        <div className="blog-post">
            <h1>Shuky Meyer's Guest Visit and AI Essay</h1>
            <small>02-09-2026</small>
            <p>
                This week, I'll be giving my key takeaways from Shuky Meyer's visit as a guest speaker in our class. Along with that, I've been given Cory Doctorow's essay, <a href="https://www.theguardian.com/us-news/ng-interactive/2026/jan/18/tech-ai-bubble-burst-reverse-centaur" target="_blank" rel="noopener noreferrer">AI Companies Will Fail</a>. After reading, I'll write my own response to the ideas in the essay.
            </p>
            <br />
            <h2>Shuky Meyer's Visit</h2>
            <p>
                <a href="https://www.theguardian.com/us-news/ng-interactive/2026/jan/18/tech-ai-bubble-burst-reverse-centaur" target="_blank" rel="noopener noreferrer">Shuky Meyer</a> is a Software Engineer at AuditBoard with a background in AI development enablement who gave a fascinating talk to my class, about AI development. After listening to his presentation, there's one very important point that he made no less than 5 times; it's the idea that AI is a probability landscape that the user is in charge of shaping. What that means is that your conversations with an AI agent don't consist of questions and answers. Those conversations with AI agents are really just instances of the user constraining the output space of the agent. 
            </p>
            <br />
            <h2>My Thoughts on Cory Doctorow's AI Essay</h2>
            <p>
                Thoughts...
            </p>
        </div>
    );
}

export default Three;
